  `modi_el` datetime NOT NULL,
  PRIMARY KEY (`idedocta`),
  UNIQUE KEY `cicfamalupagonumpagemp` (`idciclo`,`clave_nivel`,`idfamilia`,`idalumno`,`idpago`,`num_pago`,`idemp`),
  KEY `famalu` (`idfamilia`,`idalumno`),
  KEY `famfac` (`idfamilia`,`idfactura`),
  KEY `famalupagosts` (`idfamilia`,`idalumno`,`idpago`,`status_movto`),
