--
-- Volcado de datos para la tabla `estados_de_cuenta`
--


--
-- Disparadores `estados_de_cuenta`
--
DROP TRIGGER IF EXISTS `Estados_de_Cuenta_BEFORE_UPDATE`;
DELIMITER //
CREATE TRIGGER `Estados_de_Cuenta_BEFORE_UPDATE` BEFORE UPDATE ON `estados_de_cuenta`
 FOR EACH ROW Begin
    SELECT is_descto_beca,  beca_sep, beca_arji, beca_sp, beca_bach 
    INTO @Is_Descto_Beca, @Beca_SEP, @Beca_Arji, @Beca_SP, @Beca_Bach
    FROM _viEdosCta   
    Where idedocta = new.idedocta
    limit 1; 

    if (@Is_Descto_Beca = 1) then 
        set @porcDescto = @Beca_SEP + @Beca_Arji + @Beca_SP + @Beca_Bach + new.porcdescto;
    else
        set @porcDescto = new.porcdescto;
    end if;

    set @desc = @porcDescto/100;
    set @descto = new.subtotal * @desc;
    set new.descto = @descto;
    set new.importe = new.subtotal - @descto;
    set @rec = new.porcrecargo/100;
    set @recargo = new.subtotal * @rec;
    set new.recargo = @recargo;
    set new.total = new.importe + new.recargo;    	 

End
//
DELIMITER ;

