-- Estructura para la vista `_viEdosCta`
--
DROP TABLE IF EXISTS `_viEdosCta`;

CREATE ALGORITHM=UNDEFINED DEFINER=`tecnoint`@`localhost` SQL SECURITY DEFINER VIEW `_viEdosCta` AS select `edocta`.`idedocta` AS `idedocta`,`edocta`.`idciclo` AS `idciclo`,`edocta`.`clave_nivel` AS `clave_nivel`,`p`.`nivel` AS `nivel`,`p`.`nivel_fiscal` AS `nivel_fiscal`,`p`.`clave_registro_nivel` AS `clave_registro_nivel`,`edocta`.`idfactura` AS `idfactura`,`edocta`.`idfamilia` AS `idfamilia`,`f`.`familia` AS `familia`,`f`.`nombre_tutor` AS `tutor`,`edocta`.`idalumno` AS `idalumno`,`f`.`alumno` AS `alumno`,`f`.`nombre_alumno` AS `nombre_completo_alumno`,`f`.`curp` AS `curp`,`f`.`rfc` AS `rfc`,`f`.`matricula_oficial` AS `matricula_oficial`,`f`.`genero` AS `genero`,`f`.`beca_sep` AS `beca_sep`,`f`.`beca_arji` AS `beca_arji`,`f`.`beca_sp` AS `beca_sp`,`f`.`beca_bach` AS `beca_bach`,`edocta`.`idpago` AS `idpago`,`p`.`idconcepto` AS `idconcepto`,`p`.`concepto` AS `concepto`,`edocta`.`num_pago` AS `num_pago`,(case when (`edocta`.`num_pago` = 1) then 'SEP' when (`edocta`.`num_pago` = 2) then 'OCT' when (`edocta`.`num_pago` = 3) then 'NOV' when (`edocta`.`num_pago` = 4) then 'DIC' when (`edocta`.`num_pago` = 5) then 'ENE' when (`edocta`.`num_pago` = 6) then 'FEB' when (`edocta`.`num_pago` = 7) then 'MAR' when (`edocta`.`num_pago` = 8) then 'ABR' when (`edocta`.`num_pago` = 9) then 'MAY' when (`edocta`.`num_pago` = 10) then 'JUN' when (`edocta`.`num_pago` = 11) then 'JUL' when (`edocta`.`num_pago` = 12) then 'AGO' else 'DESCONOCIDO' end) AS `mes`,`edocta`.`subtotal` AS `subtotal`,`edocta`.`porcdescto` AS `porcdescto`,`edocta`.`descto` AS `descto`,`edocta`.`importe` AS `importe`,`edocta`.`porcrecargo` AS `porcrecargo`,`edocta`.`recargo` AS `recargo`,`edocta`.`total` AS `total`,`edocta`.`is_vencimiento` AS `is_vencimiento`,`edocta`.`vencimiento` AS `vencimiento`,(to_days(`edocta`.`vencimiento`) - to_days(now())) AS `dias_que_faltan_para_vencer`,`edocta`.`fecha_de_pago` AS `fecha_de_pago`,`edocta`.`idmetododepago` AS `idmetododepago`,`mdp`.`metodo_de_pago` AS `metodo_de_pago`,`edocta`.`referencia` AS `referencia`,`edocta`.`status_movto` AS `status_movto`,concat(`fac`.`serie`,'-',`fac`.`folio`) AS `cfolio`,`fac`.`isfe` AS `isfe`,`fac`.`UUID` AS `UUID`,`fac`.`pdf` AS `pdf`,`fac`.`xml` AS `xml`,`fac`.`directorio` AS `directorio`,`edocta`.`origen` AS `origen`,`edocta`.`recibo_impreso` AS `recibo_impreso`,`edocta`.`deuda_anterior` AS `deuda_anterior`,`p`.`is_descto_beca` AS `is_descto_beca`,`p`.`is_pagos_diversos` AS `is_pagos_diversos`,`p`.`is_siguiente_nivel` AS `is_siguiente_nivel`,`p`.`aplica_a` AS `aplica_a`,`p`.`idemisorfiscal` AS `idemisorfiscal`,`p`.`razon_social` AS `razon_social`,`f`.`observaciones_pagos` AS `observaciones_pagos`,`f`.`convenios` AS `convenios`,`edocta`.`idemp` AS `idemp` from ((((`estados_de_cuenta` `edocta` left join `_viFamAlu` `f` on(((`edocta`.`idfamilia` = `f`.`idfamilia`) and (`edocta`.`idalumno` = `f`.`idalumno`)))) left join `_viPagos` `p` on((`edocta`.`idpago` = `p`.`idpago`))) left join `facturas_encabezado` `fac` on((`edocta`.`idfactura` = `fac`.`idfactura`))) left join `cat_metodos_de_pago` `mdp` on((`edocta`.`idmetododepago` = `mdp`.`idmetododepago`))) order by `edocta`.`idedocta`;

