--
-- Eventos
--
CREATE EVENT `Actualiza_Pagos_Metodo_A` ON SCHEDULE EVERY 1 DAY STARTS '2014-12-09 00:05:00' ON COMPLETION NOT PRESERVE ENABLE DO Begin
DECLARE ID INT Default 0;
DECLARE xIdFamilia INT Default 0;

DECLARE cur CURSOR FOR 
SELECT distinct idfamilia
FROM _viFamAlu
where  status_famalu = 1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET ID = 1;

OPEN cur;

bucle: LOOP

	FETCH cur INTO xIdFamilia;
		IF (ID = 1) THEN
			LEAVE bucle;
		END IF;

	Set @X = Actualizar_Pagos_Metodo_A(xIdFamilia,0);        

END LOOP bucle;

			VALUES(-1,NOW(),'Event','UpdatePagos',xIdFamilia,'Update Pagos'); 
            
CLOSE cur;



End$$

